import React, { useEffect, useState } from "react";
import Navbar from "./Navbar";

const MaListe = () => {
  const [items, setItems] = useState([]);

  useEffect(() => {
    const storedItems = JSON.parse(localStorage.getItem("items"));
    if (storedItems) {
      setItems(storedItems);
    }
  }, []);
  return (
    <div>
      <Navbar />
    </div>
  );
};

export default MaListe;
